window = Tk()

running = True  # Global flag
BASE64_BACKGROUND = ''

image_file = io.BytesIO(base64.b64decode(BASE64_BACKGROUND))
image = Image.open(image_file)
width, height = image.size
# I disallow window to resizing and I make the size of the window the same than the size of the background image
window.resizable(width=False, height=False)
window.geometry("%sx%s"%(width, height))
draw = ImageDraw.Draw(image)
text_x = 5
text_y = 5

usernametext = "Username"
passwordtext = "Password"
profilestext = "Profiles"
hashtagtext = "Hashtags"
logtext = "Log"

width_text, height_text = draw.textsize(usernametext)
draw.text((text_x, text_y), usernametext, fill="white")
draw.text((5, 35), passwordtext, fill="white")
draw.text((220, 5), profilestext, fill="white")
draw.text((220, 35), hashtagtext, fill="white")
draw.text((260, 90), logtext, fill="white")




