photoimage = ImageTk.PhotoImage(image)
Label(window, image=photoimage).place(x=0,y=0)
entry_pady = 7
Entry(window, background="white")


def run_process():
    path = r"path/to/script"
    p = subprocess.run("python"+path, stdout=subprocess.PIPE)
    return p.stdout


def windows(title, size):
    window.title(title)
    window.geometry(size)


def username():
    global usernametxt
    usernametxt = Entry(window,width=20)
    usernametxt.grid(column=1, row=0)
    usernametxt.place_configure(x=70, y=5)


def password():
    global passwordtxt
    passwordtxt = Entry(window,width=20)
    passwordtxt.grid(column=1, row=1)
    passwordtxt.place_configure(x=70, y=35)


def profiles():
    global profilestxt
    profilestxt = Entry(window,width=20)
    profilestxt.grid(column=3, row=0)
    profilestxt.place_configure(x=290, y=5)

def hashtags():
    global hashtagstxt
    hashtagstxt = Entry(window,width=20)
    hashtagstxt.grid(column=3, row=1)
    hashtagstxt.place_configure(x=290, y=35)


def clicked():
    lbl = Label(window, text="Bot Running")
    usernames = usernametxt.get()
    passwords = passwordtxt.get()
    profiles = profilestxt.get()
    instagramtags = hashtagstxt.get()
    lbl.grid(column=5, row=0)
    global running
    running = True
    bot.main(usernames, passwords, profiles, instagramtags)

def stopped():
    lbl = Label(window, text="Bot stopped")
    lbl.grid(column=5, row=1)
    global running
    running = False

def button():
    btn = Button(window, text="Run Bot", command=clicked)
    btn.grid(column=5, row=0)
    btn.place_configure(x=450, y=25)

def stop():
    btn = Button(window, text="Stop Bot", command=stopped)
    btn.grid(column=5, row=1)

def logoutput():
    with open('instabot.log') as f:
        read_data = f.readlines()
    f.closed

    txt = scrolledtext.ScrolledText(window, width=47, height=20)
    txt.insert(tkinter.END, read_data[-20:-1])
    txt.grid(column=1,row=1)
    txt.place(x=250,y=120)
    window.after(10000, logoutput)

def main():
    windows("Instabotai", "600x400")
    username()
    password()
    profiles()
    hashtags()
    button()
    logoutput()

    window.mainloop()
